import { useState } from "react";

// parent component
function Parent(){
    const data = "Hello from parents";
    const [name, setName] = useState("Fjolla");

    return(
        <Child message={data} username={name} />
    );
}

//child component
function Child({message, username}){
    return(
        <div>{message}</div>
    )
}

export default Parent;
